import React, { Component } from "react";
import IntlMessages from "../../../../util/IntlMessages";
import Dialog from "@material-ui/core/Dialog";
import DialogActions from "@material-ui/core/DialogActions";
import DialogContent from "@material-ui/core/DialogContent";
import DialogContentText from "@material-ui/core/DialogContentText";
import Slide from "@material-ui/core/Slide";
import Button from "@material-ui/core/Button";
import moment from "moment";

export default class PassTestConfirm extends Component {
  constructor(props) {
    super(props);

    this.state = {};
  }

  render() {
    var currentDay = moment();
    var limitDate = moment(this.props.limitDate).add(1, "day");

    var access = currentDay.diff(limitDate) < 0;

    return (
      <Dialog
        open={this.props.openModalConfirm}
        TransitionComponent={Slide}
        onClose={this.props.closeModalConfirm}
      >
        <DialogContent>
          <DialogContentText>
            {access ? (
              <IntlMessages id="level.test.confirm.pass" />
            ) : (
              <IntlMessages id="level.test.expired" />
            )}
          </DialogContentText>
        </DialogContent>
        <DialogActions>
          {access ? (
            <>
              <Button onClick={this.props.closeModalConfirm} color="secondary">
                {<IntlMessages id="button.no" />}
              </Button>
              <Button onClick={this.props.openPassTestModal} color="primary">
                {<IntlMessages id="button.yes" />}
              </Button>
            </>
          ) : (
            <Button onClick={this.props.closeModalConfirm} color="secondary">
              ok
            </Button>
          )}
        </DialogActions>
      </Dialog>
    );
  }
}
